,p_plug_name=>unistr('Dy\017Cury_raport')
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_api.id(89119947759976875959)
,p_plug_display_sequence=>30
,p_plug_new_grid_row=>false
,p_plug_new_grid_column=>false
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'with dates as (',
'  select trunc(sysdate) + level - 1 dt',
'  from   dual d',
'  connect by level <= (',
'    trunc(sysdate + (select VALUE from SETTINGS where CODE = ''DAYS_FORWARD'')) + 1 - trunc(sysdate)',
'  )',
')',
'select ',
'    dates.dt,',
'    ts.id,',
'    ts.the_order,',
'    ts.NAME,',
'    count(v.id) || '' / '' ',
'    || ',
'    case ',
'      when vts.id is not null and vtstl.sum_type_limit > vts.VOLUNTEERS_LIMIT then to_char(vtstl.sum_type_limit) ',
'      when vts.id is not null and vtstl.sum_type_limit <= vts.VOLUNTEERS_LIMIT then to_char(vts.VOLUNTEERS_LIMIT) ',
'      else (select VALUE from SETTINGS where CODE = ''VOLUNTEERS_LIMIT'') ',
'    end COUNT_VOLUNTEERS,',
'    ts.id stats,',
'    dates.dt date_parameter,',
'    ts.id sign_up',
'',
'from dates',
'  join time_slots ts',
'    on 1 = 1',
'  left join VOLUNTEERS v',
'    on trunc(v.THE_DATE) = trunc(dates.dt)',
'    and ts.ID = v.TIME_SLOT',
'  left join VOLUNTEERS_TIME_SLOTS vts',
'    on trunc(dates.dt) = trunc(vts.DATE_NAME)',
'    and ts.ID = vts.TIME_SLOT_ID',
'  left join',
'    (select',
'      VOLUNTEERS_TIME_SLOTS_ID,  ',
'      sum(TYPE_LIMIT) sum_type_limit',
'    from',
'      VOLUNTEERS_TIME_SLOT_TYPE_LIMITS',
'    group by VOLUNTEERS_TIME_SLOTS_ID',
'    ) vtstl',
'  on',
'    vtstl.VOLUNTEERS_TIME_SLOTS_ID=vts.id',
'where',
'  1 = 1',
'  and current_date <=  case when ts.HOUR_END < ts.HOUR_START then trunc(dates.dt - 1,''DD'') +  ts.HOUR_START/24 else trunc(dates.dt,''DD'') +  ts.HOUR_START/24 end',
'group by ',
'    dates.dt,',
'    ts.NAME,',
'    ts.id,',
'    ts.THE_ORDER,',
'    vts.id,',
'    vts.VOLUNTEERS_LIMIT,',
'    vtstl.sum_type_limit',
'order by dates.dt, ts.THE_ORDER'))
,p_plug_source_type=>'NATIVE_IR'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
