'       v.NAME,',
'       v.SURNAME,',
'       ( select listagg(NAME, '', '') WITHIN GROUP (ORDER BY NAME)',
'         from VOLUNTEER_TYPES',
'         where CODE in (select * from table(apex_string.split(v.TYPE, '':'')))',
