wwv_flow_api.create_page_computation(
 p_id=>wwv_flow_api.id(89146377658015959591)
,p_computation_sequence=>10
,p_computation_item=>'P3_MIN_DATE'
,p_computation_point=>'BEFORE_BOX_BODY'
,p_computation_type=>'FUNCTION_BODY'
,p_computation_language=>'PLSQL'
,p_computation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'    v_min_date date;',
'    v_vol_date date;',
'begin',
'    if APEX_AUTHENTICATION.IS_PUBLIC_USER',
'    then ',
'      v_min_date := current_date;',
'    else',
'      v_min_date := to_date(''01-03-2022'', ''DD-MM-YYYY'');',
'    end if;',
'',
'    if :P3_ID is not null then',
'        select THE_DATE',
'        into v_vol_date',
'        from VOLUNTEERS ',
'        where ID = :P3_ID;',
'',
'        if v_vol_date < v_min_date then',
'            v_min_date := v_vol_date;',
'        end if;',
'    end if;',
'',
'    return v_min_date;',
'end;'))
);
