wwv_flow_api.create_page_validation(
 p_id=>wwv_flow_api.id(89125428458784013870)
,p_validation_name=>'Check if slots are full'
,p_validation_sequence=>160
,p_validation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
unistr('  v_slots number; --ilo\015B\0107 os\00F3b na miejsce'),
'  v_slots_max number;  --max slotu',
'  v_slot_id number; ',
'  v_slot_for_type_max number;',
'  v_slot_type_sum number;',
'  ',
'begin',
'',
'  begin',
'    --limit na slot',
'    select',
'      vts.ID,',
'      vts.VOLUNTEERS_LIMIT',
'    into',
'      v_slot_id,',
'      v_slots_max',
'    from',
'      VOLUNTEERS_TIME_SLOTS vts',
'    where',
'      vts.TIME_SLOT_ID = :P3_TIME_SLOT',
'      and trunc(vts.DATE_NAME) =  trunc(to_date(:P3_THE_DATE));',
'',
'    --limit na typ',
'    begin',
'      select',
'        vtsl.TYPE_LIMIT ',
'      into',
'        v_slot_for_type_max',
'      from',
'        VOLUNTEERS_TIME_SLOT_TYPE_LIMITS vtsl',
'      where',
'        vtsl.VOLUNTEERS_TIME_SLOTS_ID = v_slot_id',
'        and vtsl.VOLUNTEER_TYPES_ID = (select ID from VOLUNTEER_TYPES where code = :P3_TYPE);',
'    exception ',
'    when no_data_found then',
'      v_slot_for_type_max:= null;',
'    when others then',
'      raise;',
'    end;',
'    ',
'    select ',
'      sum(vtsl.TYPE_LIMIT)',
'    into',
'      v_slot_type_sum',
'    from',
'      VOLUNTEERS_TIME_SLOT_TYPE_LIMITS vtsl',
'    where',
'        vtsl.VOLUNTEERS_TIME_SLOTS_ID = v_slot_id;',
'',
unistr('    if v_slot_for_type_max is not null then -- je\015Bli mamy limit dla naszego typu, to jest on naszym max-em'),
'      v_slots_max:=v_slot_for_type_max;',
unistr('    elsif v_slot_type_sum is not null then --je\015Bli nie ma limitu dla naszego typu, ale dla innych s\0105, to pozosta\0142a pula jest naszym maxem'),
'      v_slots_max:= v_slots_max - v_slot_type_sum;',
'    else ',
'      v_slots_max:= null;',
'    end if;',
'',
'  exception ',
'    when no_data_found then',
'      v_slots_max:= null;',
'    when others then',
'      raise;',
'  end; ',
'',
unistr('  if v_slots_max is null then  -- je\015Bli do tej pory nie mamy max-a, to znaczy \017Ce limit globalny'),
'    select s.VALUE',
'      into v_slots_max',
'    from SETTINGS s',
'      where s.CODE = ''VOLUNTEERS_LIMIT''',
'    ;',
'  end if;',
'',
unistr('  if v_slot_for_type_max is not null then -- je\015Bli mamy limit dla naszego typu, to sprawdzamy ile jest ludzi tego typu'),
'    select count(1)',
'      into v_slots',
'      from volunteers',
'    where trunc(THE_DATE) = trunc(to_date(:P3_THE_DATE))',
'      and TYPE = :P3_TYPE',
'      and TIME_SLOT = :P3_TIME_SLOT;',
unistr('  elsif v_slot_type_sum is not null and v_slot_id is not null then -- je\015Bli mamy limit na typy, ale jeste\015Bmy innym, to patrzymy ile jest takich w pozosta\0142ych typach'),
'    select count(1)',
'      into v_slots',
'      from volunteers',
'    where trunc(THE_DATE) = trunc(to_date(:P3_THE_DATE))',
'      and TYPE not in (select vt.CODE from VOLUNTEERS_TIME_SLOT_TYPE_LIMITS vtstl join VOLUNTEER_TYPES vt on vt.id = vtstl.VOLUNTEER_TYPES_ID where VOLUNTEERS_TIME_SLOTS_ID = v_slot_id) ',
'      and TIME_SLOT = :P3_TIME_SLOT;',
'  else --patrzymy na wszystkich',
'    select count(1)',
'      into v_slots',
'      from volunteers',
'    where trunc(THE_DATE) = trunc(to_date(:P3_THE_DATE))',
'      and TIME_SLOT = :P3_TIME_SLOT;',
'  end if;',
'',
'  if :P3_TYPE like ''%TRANSLATOR%'' then',
'    return true;  ',
'  elsif v_slots < v_slots_max then',
'    return true;',
'  else',
'    return false;',
'  end if;',
'',
'end;'))
,p_validation2=>'PLSQL'
,p_validation_type=>'FUNC_BODY_RETURNING_BOOLEAN'
,p_error_message=>unistr('Maksymalna ilo\015B\0107 ch\0119tych ju\017C zosta\0142a osi\0105gni\0119ta na podany dy\017Cur. Prosimy o wybranie innego przedzia\0142u czasowego lub innej roli.')
,p_validation_condition=>'return :P3_TYPE is not null and apex_authentication.is_public_user;'
,p_validation_condition2=>'PLSQL'
,p_validation_condition_type=>'FUNCTION_BODY'
,p_error_display_location=>'INLINE_WITH_FIELD_AND_NOTIFICATION'
);
