,p_display_sequence=>90
,p_value_alignment=>'CENTER'
,p_is_required=>false
,p_lov_type=>'SQL_QUERY'
,p_lov_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'select',
'  NAME,',
'  ID',
'from',
'(',
'  select',
'      NAME,',
'      ID,',
'      THE_ORDER',
'  FROM',
'      TIME_SLOTS ts',
'  where',
'   current_date <=  case when ts.HOUR_END < ts.HOUR_START then trunc(to_date(:DATE_NAME)- 1,''DD'') +  ts.HOUR_START/24 else trunc(to_date(:DATE_NAME),''DD'') +  ts.HOUR_START/24 end ',
'    and not exists (',
'        select 1',
'        from ',
'          VOLUNTEERS_TIME_SLOTS vts',
'        where',
'          vts.TIME_SLOT_ID = ts.ID',
'        and ',
'          vts.DATE_NAME = :DATE_NAME',
'      )',
'  union',
'    select ',
'      NAME,',
'      ID,',
'      THE_ORDER',
'    from',
'      TIME_SLOTS ts',
'    where',
'      ts.ID = :TIME_SLOT_ID',
'  order by THE_ORDER',
')',
''))
